#include <iostream>
#include <cstring>
using namespace std;
int ans[1005],vis[1005];
int main(int argc, char** argv) {
	int T;
	cin >> T;
	while(T--)
	{
		string a;
		cin >> a;
		memset(vis,0,sizeof vis);
		memset(ans,0,sizeof ans);
		a+=' ';
		for(int i=0;i<a.size()-1;i++)
		{
			if(vis[i])
				continue;
			for(int j=i;j<a.size()-1;j++)
			{
				vis[j]=1;
				if(a[j]!=a[j+1])
				{
					if((j-i+1)%2==1)
						ans[a[i]]=1;
					break;
				}
			}
		}
		for(int i='a';i<='z';i++)
		{
			if(ans[i])
				cout << char(i);
		}
		cout << endl;
	}
	return 0;
}